import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

const router = createBrowserRouter([
  {
    path: '/',
    element: <Quiz />
  },
])

root.render(
  <React.StrictMode>
   <RouterProvider router={router} />
  </React.StrictMode>
);
